import '../../styles/Gallery/Gallery.css'
import Thumb from '../Gallery/Thumb'
import { zer } from '../../datas/logements'

function Gallery() {
	return (
	<ul className='kasa-housing-list'>
	{zer.map(housing => (
		<Thumb
			key={housing.id}
			id={housing.id}
			cover={housing.cover}
			title={housing.title}
			/>
		))}
	</ul>
	)
}

export default Gallery
